import React from 'react';
// import PropTypes from 'prop-types';
import { useDispatch } from 'react-redux';
import { removeCoin } from '../../Store/actions';

function Coin({ task }) {
  const {
    name, count, priceUsd, totalpriceUsd, key,
  } = task;

  const dispatch = useDispatch();

  return (
    <div className="row my-1" id={key}>
      <div className="col-lg col-sm">
        {name}
      </div>
      <div className="col-lg col-sm">
        {count}
      </div>
      <div className="col-lg col-sm">
        $
        {priceUsd}
      </div>
      <div className="col-lg col-sm">
        $
        {totalpriceUsd}
      </div>
      <div className="col-lg col-sm">
        <span onClick={() => dispatch(removeCoin(key))} role="button" tabIndex={0} onKeyDown={() => dispatch(removeCoin(key))}>Remove</span>
      </div>
    </div>

  );
}

// Coin.propTypes = {
//   task: PropTypes.object,
// };

export default Coin;
